import React from "react";
const {useState} =React;


const Search = () => {

    const [Search,setSearch] = useState("");

    const onChange = (evt) => {
        console.log(evt.target.value);
        setSearch = evt.target.value;

         
    }
    return (
        <div>
            <div>
                <input
                    placeholder="¿Qué pokemon quieres conocer?"
                    onChange={onChange}
                />
            </div>
        <div>
        {Search}
        </div>
        </div>
    )

};

export default Search;
